import React, { useState } from 'react'
import {
  Button,
  Cascader,
  DatePicker,
  Form,
  Input,
  InputNumber,
  Mentions,
  Modal,
  Select,
  TreeSelect,
  Upload,
} from 'antd';
import { PlusOutlined } from '@ant-design/icons';
const { RangePicker } = DatePicker;
const formItemLayout = {
  labelCol: {
    xs: {
      span: 24,
    },
    sm: {
      span: 6,
    },
  },
  wrapperCol: {
    xs: {
      span: 24,
    },
    sm: {
      span: 14,
    },
  },
};
export default function Home() {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const showModal = () => {
    setIsModalOpen(true);
  };
  const handleOk = () => {
var data=new FormData()
data.append("phone",document.querySelector().value  )
    //   text not null,
//  "email" text not null,
//  "address" text not null,
//  "facebook" text not null,
//  "lan" text not null,
//  "lac" text not null,
//  "telegram" text not null,
//  "youtobe" text not null,
//  "instagram" text not null,
//  "image" text not null,



  };
  const handleCancel = () => {
    setIsModalOpen(false);
  };
  return (
    <div>
      
      <Button type="primary" onClick={showModal}>
      Create Company
      </Button>
      <Modal title="Create Company" open={isModalOpen} onOk={handleOk} onCancel={handleCancel}>
      <Form
    {...formItemLayout}
    variant="filled"
    style={{
      maxWidth: 600,
    }}
  >
    <Form.Item
      label="Address"
      name="Input"
      rules={[
        {
          required: true,
          message: 'Iltimos manzilni kiriting!',
        },
      ]}
    >
      <Input />
    </Form.Item>

    <Form.Item
      label="Email"
      name="InputAddress"
      rules={[
        {
          required: true,
          message: 'Iltimos emailni kiriting!',
        },
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      label="Facebook"
      name="InputFacebook"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      label="Telegram"
      name="InputTelegram"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      label="Youtobe"
      name="InputYoutube"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      label="Instagram"
      name="InputInstagram"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      label="Phone"
      name="InputNumber"
      rules={[
        {
          required: true,
          message: 'Iltimos raqamni kititing!',
        },
      ]}
    >
      <InputNumber
        style={{
          width: '100%',
        }}
      />
    </Form.Item>
    <Form.Item label="Upload" valuePropName="fileList">
          <Upload action="/upload.do" listType="picture-card">
            <button
              style={{
                border: 0,
                background: 'none',
              }}
              type="button"
            >
              <PlusOutlined />
              <div
                style={{
                  marginTop: 8,
                }}
              >
                Upload
              </div>
            </button>
          </Upload>
        </Form.Item>
  </Form>
      </Modal>

    </div>
  )
}
